INSERT IGNORE INTO `#__toes_mail_templates` (`tmpl_id`, `tmpl_name`, `action_name`, `smtp_id`, `mail_subject`, `mail_body`) VALUES
(1, 'Access request for one of the cats in your account', 'cat_relation_permission', 1, '[name] requested permission to get access to the data record of [cat_name]', '<p>This is an automated email from TOES - do NOT reply to this email. Your mail will not be read/handled.<br /><br />This email is generated because[name] requested permission to get access to the data record of [cat_name] <br />They are requesting to have the following access level : [permission] - you can find a description of the access levels at the end of this email.</p>\r\n<p>If you do <strong>NOT</strong> want to grant this access, you do not have to do anything.<br />If you want to grant the requested access please click on following link:<a href=\"[link]\">[link]</a></p>\r\n<p><br />Best regards<br />The TOES Team<br /><br />FYI - Access Levels</p>\r\n<table>\r\n<tbody>\r\n<tr style=\"height: 35.625px;\">\r\n<td style=\"text-align: center; height: 35.625px;\">Access Level</td>\r\n<td style=\"text-align: center; height: 35.625px;\">Can View <br />Cat Data</td>\r\n<td style=\"text-align: center; height: 35.625px;\">Can Edit<br />Cat Data</td>\r\n<td style=\"text-align: center; height: 35.625px;\">Can Enter Cat<br />in Shows</td>\r\n<td style=\"text-align: center; height: 35.625px;\">Can grant/revoke<br />Owner level access</td>\r\n<td style=\"text-align: center; height: 35.625px;\">Can grant/revoke<br />Lessee,Breeder,Agent<br />level access</td>\r\n</tr>\r\n<tr style=\"height: 15px;\">\r\n<td style=\"text-align: center; height: 15px;\">Owner</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n</tr>\r\n<tr style=\"height: 15px;\">\r\n<td style=\"text-align: center; height: 15px;\">Lessee</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">X</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n</tr>\r\n<tr style=\"height: 15px;\">\r\n<td style=\"text-align: center; height: 15px;\">Breeder</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">X</td>\r\n<td style=\"text-align: center; height: 15px;\">X</td>\r\n<td style=\"text-align: center; height: 15px;\">X</td>\r\n<td style=\"text-align: center; height: 15px;\">X</td>\r\n</tr>\r\n<tr style=\"height: 15px;\">\r\n<td style=\"text-align: center; height: 15px;\">Agent</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">X</td>\r\n<td style=\"text-align: center; height: 15px;\">V</td>\r\n<td style=\"text-align: center; height: 15px;\">X</td>\r\n<td style=\"text-align: center; height: 15px;\">X</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p></p>'),
(2, 'Show License Application', 'show_license_application', 1, 'Show License Application from [club]', '<p>Dear Executive Office, <br /><br /> The [club] is organizing a [show_format] show in [show_location], from [Startdate] - [Enddate].<br /> This club belongs to the [regionname] region.[first_show] <br /><br /> The Show manager(s) for this show are:<br />[show_manager_contact] <br /><br /> The club would [NOT] like to receive show supplies.[shipping_info] <br /><br /> Insurance information:<br />[insurance_info] <br /><br /> The following rings have been scheduled:<br />[rings] <br /><br /> So a total of [ab_rings] AB rings, [sp_rings] SP rings, and [congress_rings] congresses.<br /><br /> This comes to a total of: <br /> License fee: USD 15 X [ab_rings] + USD 15 X [sp_rings] + USD 10 X [congress_rings] = USD [license_fee]<br /> Annual Awards Fee: USD 20 X [ab_rings] + USD 20 X [sp_rings] = USD [anual_award_fee]<br /> Total Fee= USD [total_fee]</p>'),
(3, 'Entryclerk Notification - Entry Added', 'entry_added_entryclerk_notification', 2, '[club name] [showdates] [exhibitor]: A new entry was received', '<p>[exhibitor] has just submitted a new entry for the [club name] show in [City][, [State]] - [Country] on [showdates]. <br /><br /> Please log in to <a href=\"https://www.i-tica.com/\">TOES</a> to process the new entries.</p>'),
(4, 'Exhibitor Notification - Entry Added', 'entry_added_exhibitor_notification', 2, 'A new entry added for show of [club name] on [showdates]', '<p>This is an automated email, <strong>DO NOT REPLY</strong> to this email. Your email will not be read/handled.<br />If you needto contact someone,use the link below to contact your entry clerk.</p>\r\n<p>Dear [exhibitor],</p>\r\n<p><br />You have just entered [cat] for the [club name] show in [City][, [State]] - [Country].<br />Your entry will be handled by our entry clerk shortly after which you will receive a confirmation email.</p>\r\n<p>You can view the details of your entries for this show by clicking the following link: [show_link]</p>\r\n<p>Best regards<br />[club name]</p>\r\n<p><br />If you have specific questions, please contact the entry clerk at [entry-clerk email]</p>'),
(5, 'Exhibitor Notification - Entry Rejected ', 'entry_rejected_exhibitor_notification', 2, 'Attention, one of your entries was rejected!', '<p>This is an automated email,<strong>DO NOT REPLY</strong>to this email. Your email will not be read/handled.<br />If you needto contact someone,use the link below to contact your entry clerk.</p>\r\n<p>Dear [Firstname] [Lastname],</p>\r\n<p>Your entry for [cat name] into the show of [club], to be held in [show location] on [startdate][ - [enddate]], was rejected. The entry is rejected for:[showdaylist].<br />Following reason was provided:<br /> [rejection reason]<br /><br />Please contact the entryclerk ([entryclerkemailaddress]) for additional information.</p>'),
(6, 'Entry Cancelled Entryclerk Notification', 'entry_cancelled_entryclerk_notification', 2, 'An exhibitor cancelled an entry for the [club] show in [show_location] on [showdates]', '<p>[exhibitor] has cancelled the following entry:<br />[cat] - [show_class] - [show_days]</p>'),
(7, 'Placeholder Created', 'placeholder_created_notification', 2, '[club name] [showdates] [exhibitor]: A new placeholder was received', '<p>[exhibitor] has just submitted a new placeholder for the [club name] show in [City][, [State]] - [Country] on [showdates] <br /><br /> Please log in to <a href=\"https://www.i-tica.com\">TOES</a> to process the new entries.</p>'),
(8, 'Placeholder Cancelled', 'placeholder_cancelled_notification', 2, 'An exhibitor cancelled a placeholder for the [club] show in [show_location] on [showdates]', '<p>[exhibitor] has cancelled a placeholder: [show_days]</p>'),
(9, 'Entry Confirmation', 'entry_confirmation_notification', 2, 'TOES - [club name] [showdates]: Entry Confirmation', '<div><br />\r\n<p>This is an automated email,<strong>DO NOT REPLY</strong>to this email. Your email will not be read/handled.<br />If you needto contact someone,please contact your entry clerk.</p>\r\n<p></p>\r\nDear [Firstname] [Lastname],<br /><br /> Thank you for your entries to the [club_abbreviation] cat show in [City][, [State]] - [Country] from [Startdate] - [Enddate].</div>\r\n<div></div>\r\n<div>\r\n<div><strong><span style=\"text-decoration: underline;\">Summary :</span></strong><br /><br /> We have reserved [single_cages] single, and [double_cages] double cages/spaces for you. <br /><br /> You [grooming_space] a grooming space <br /><br /> You [personal_cages] be bringing your personal Show cages <br /><br /> You have expressed following benching request: [benching_request] <br /><br /> Following remarks were received: [remarks]</div>\r\n<div></div>\r\n<div>These are the comments of your entry clerk:</div>\r\n<div></div>\r\n<div>[summary_entry_clerk_note]</div>\r\n<div><br /> If you have any concerns regarding this information, please contact our entry clerk immediately. <br /><br /> [entry_clerk_email_address]<br /><br /> [PAYMENT Block]</div>\r\n<div></div>\r\n<div>[Extra Information Block]</div>\r\n<br /> <strong>Please make sure you pay your entry fees immediately.</strong><br /> The total sum of your entry fees is [total_sum][show_currency_used].<br /> So far we have received [sum_paid] [show_currency_used], which leaves a balance of [due_sum] [show_currency_used]<br /><br /> <strong><span style=\"text-decoration: underline;\">Here is an overview of your entries :</span></strong><br /><br /> <strong><span style=\"text-decoration: underline;\">New Entries/Placeholders :</span></strong><br /> [New Entries Block]</div>\r\n<div>\r\n<div></div>\r\n<div><br />[NEW Placeholder Block]</div>\r\n</div>\r\n<div><br /><strong><span style=\"text-decoration: underline;\">Entries already previously confirmed :</span></strong></div>\r\n<div><br /> [Previous Entries Block]</div>\r\n<div></div>\r\n<div><br /> [OLD Placeholder Block]</div>\r\n<div><br /><br /></div>'),
(10, 'Show Approval Application', 'show_approval_application', 1, 'FYA: [clubname] has (re)scheduled a show for [showdates] - Your approval is required', '<div>Dear [firstname],<br /><br /> The club [clubname] has (re)scheduled a show to be held in [location] on [showdates].<br /><br /> The show requires your approval before being published on the show calendar, in accordance to the current settings for the [region_name] region. Please visit the <a href=\"[show_calendar_link]\">show calendar</a> and approve the show.<br /><br /> If you would like to change this default setting so that shows require your approval before being published on the calendar, then please contact the <a href=\"mailto:admin@toes.com\">Toes system administrator</a></div>'),
(11, 'Show w/o approval application', 'show_wo_approval_application', 1, 'FYI: [clubname] has (re)scheduled a show for [showdates]', '<div>Dear [firstname],<br /><br /> The club [clubname] has (re)scheduled a show to be held in [location] on [showdates].</div>\r\n<div><br /> The show was automatically approved and published on the show calendar, in accordance to the current settings for the [region_name] region.<br /> If you would like to change this default setting so that shows require your approval before being published on the calendar, please contact the <a href=\"mailto:admin@toes.com\">Toes system administrator</a></div>'),
(12, 'Show approval notification', 'show_approval_notification', 1, 'Show [action]', '<p>Dear [firstname],</p>\r\n<p><br />Your show in [location] scheduled from [startdate] to [enddate] was [action] by the regional director.</p>'),
(13, 'Subscribed to show', 'subscribed_to_show', 1, 'You will now receive notifications about this show ', '<p>This is an automated email,<strong>DO NOT REPLY</strong>to this email. Your email will not be read/handled.<br />This email is being sent to you because you clicked on the subscribe button for this show.</p>\r\n<p></p>\r\n<p>Dear [firstname],</p>\r\n<p>You are now subscribed to <a href=\"[show_link]\">the show of [club name] to be held in [City][, [State]] - [Country] on [showdates]</a>.<br />If any changes are made to this show you will be informed by email.<br />You can unsubscribe from the show to stop receiving these notifications. To do so, just unsubscribe using the unsubscribe button on the show calendar next to the show.</p>\r\n<p>Best regards<br />The TOES team</p>'),
(14, 'Unsubscribed from show', 'unsubscribed_from_show', 1, 'You are now unsubscribed from this show and will no longer receive update emails for this show', '<p>This is an automated email,<strong>DO NOT REPLY</strong>to this email. Your email will not be read/handled.<br />You are receiving this email because you clicked the unsubscribe button for this show.</p>\r\n<p></p>\r\n<p>Dear [firstname],</p>\r\n<p><br />You are now unsubscribed from <a href=\"[show_link]\">the show of [club name] to be held in [City][, [State]] - [Country] on [showdates]</a>.<br />You will no longer receive notification emails about any changes that are made to this show.</p>\r\n<p><br />Best regards<br />The TOES team</p>'),
(15, 'Show update notification', 'show_update_notification', 1, 'One of the shows you are following has been updated!', '<p>This is an automated email,<strong>DO NOT REPLY</strong>to this email. Your email will not be read/handled.</p>\r\n<p>Dear [firstname],</p>\r\n<p>You are currently following the show of [club name] to be held in [City][, [State]] - [Country] on [showdates]. <br /> There was an update on this show, please <a href=\"[show_link]\">visit the show calendar</a> to get the latest information.</p>\r\n<p>Following fields were updated:<br /> [date_change] [location_change] [status_change] [format_change] [desc_change] [rings_change]</p>\r\n<p>You are receiving this email because you subscribed to this show on the show calendar. If you do not want to receive emails for this show any longer, then please <a href=\"[show_link]\">unsubscribe on the calendar</a>.</p>'),
(16, 'Cat Changes Notification', 'cat_changes_notification', 1, 'Changes in your cat details for [CAT_NAME]', '<p>This is an automated email,<strong>DO NOT REPLY</strong>to this email. Your email will not be read/handled.<br />If you needto contact someone,use the link below to contact your entry clerk.</p>\r\n<p></p>\r\n<p>Hello [firstname] [lastname], <br /><br />\" Your cat - [CAT_NAME] - has participated in the show of the [club], [SHOW_DATES], [SHOW_LOCATION] <br /><br />We noticed a few differences between the data of the entry clerk, and the ones in your cat\'s profile.<br />Please review below, and click the appropriate link to help us keep your data in TOES up to date.<br /><br />[cat_changes_table] <br /><br /> <br />This email is sent to you by TOES. After every show we check for differences between the entry clerk\'s records and your own. We point out those differences in this email. If you notice that your information is correct, and the entry clerk\'s isn\'t, then please remember to always notify the entry clerks of the shows you have already entered for, so that they can update their catalog accordingly. For new entries the data from your profile will be used, so you do not need to take extra steps there. <br /><br />Please note that the links in these emails will expire within 72 hours. If you still want to update your cat\'s data you will have to do so manually in TOES.</p>'),
(17, 'Radius search using latitude and longitude', 'radius_search_using_latitude_longitude', 2, 'shows from given distance', '<p></p>\r\n<!--p>Hello,</p>\r\n<p>Show id from given distance are [show_id] and <a href=\"[show_link]\">show link</a></p>\r\n<p>Approve or disapprove shows and link is <a href=\"[show_link]\">show link</a></p-->\r\n<p>Dear [firstname] [lastname] [show_id] ,</p>\r\n<p>You are assigned as [show_manager] [club_official] for [name_of_club]. You are currently planning the following show:</p>\r\n<p>club name [club_name] , Start date [start_date] , End Date [end_date] , location [location] , <a href=\"https://localhost/#__latest/[show_link]\" target=\"_blank\" rel=\"noopener noreferrer\">show link</a></p>\r\n<p>The club [other_club] would like to put on the following show:</p>\r\n<p>Other Club [other_club] , Start Date [other_club_start_date] , End Date [other_club_end_date] , location [other_club_location]</p>\r\n<p>The distance between these shows would be [km] km [miles] miles .</p>\r\n<p>If you and other club officials do not react to this email within the next 14 days, the new show date request will automatically be denied.</p>\r\n<p>You can contact [other_club] using the following information:<br /> name [other_firstname] [other_lastname] and email [other_email]</p>\r\n<p>If you agree to share the show date, approval from your Regional Director [firstname_of_rd] [lastname_of_rd] will also be required.</p>\r\n<p>Finally, if your Regional Director also agrees with sharing the show date,</p>\r\n<p>the other club\'s Regional Director [other_firstname_of_rd] [other_lastname_of_rd] will also need to approve your show date.\"</p>'),
(18, 'Show regional director notification', 'show_regional_director_notification', 2, 'Show regional director notification', '<p>Dear [rd_firstname] [rd_lastname][show_id] ,</p>\r\n<p>This is test mail</p>\r\n<p><a href=\"https://localhost/#__latest/[show_link]\" target=\"_blank\" rel=\"noopener noreferrer\">show link</a></p>');
